// src/models/Professor.js

class Professor {
    constructor(id = null, nome = '', email = '', matricula = '', idade = 0) {
        this.id = id;
        this.nome = nome;
        this.email = email;
        this.matricula = matricula;
        this.idade = idade;
    }
}

export default Professor;
